import React, { useState, useEffect } from 'react';
import RecipeCard from './RecipeCard';
import './RecipeList.css';

const RecipeList = ({ searchResults, filters }) => {
  const [recipes, setRecipes] = useState([]);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);

  // Mock data for demonstration - in a real app, this would come from an API
  const mockRecipes = [
    {
      id: 1,
      title: "Spaghetti Carbonara",
      cuisine: "Italian",
      cookingTime: 25,
      difficulty: "Medium",
      image: "https://images.unsplash.com/photo-1621996346565-e3dbc353d2e5?w=400",
      ingredients: ["pasta", "eggs", "bacon", "parmesan", "black pepper"],
      tags: ["Vegetarian", "Quick"]
    },
    {
      id: 2,
      title: "Chicken Tikka Masala",
      cuisine: "Indian",
      cookingTime: 45,
      difficulty: "Medium",
      image: "https://images.unsplash.com/photo-1565557623262-b51c2513a641?w=400",
      ingredients: ["chicken", "yogurt", "spices", "tomatoes", "cream"],
      tags: ["Gluten-Free"]
    },
    {
      id: 3,
      title: "French Onion Soup",
      cuisine: "French",
      cookingTime: 60,
      difficulty: "Easy",
      image: "https://images.unsplash.com/photo-1547592166-23ac45744acd?w=400",
      ingredients: ["onions", "beef broth", "bread", "cheese", "butter"],
      tags: ["Vegetarian"]
    },
    {
      id: 4,
      title: "Paella Valenciana",
      cuisine: "Spanish",
      cookingTime: 50,
      difficulty: "Hard",
      image: "https://images.unsplash.com/photo-1515443961218-a51367888e4b?w=400",
      ingredients: ["rice", "saffron", "chicken", "seafood", "vegetables"],
      tags: ["Gluten-Free"]
    },
    {
      id: 5,
      title: "Sushi Roll",
      cuisine: "Japanese",
      cookingTime: 30,
      difficulty: "Medium",
      image: "https://images.unsplash.com/photo-1579584425555-c3ce17fd4351?w=400",
      ingredients: ["rice", "nori", "fish", "vegetables", "wasabi"],
      tags: ["Gluten-Free", "Quick"]
    },
    {
      id: 6,
      title: "Thai Green Curry",
      cuisine: "Thai",
      cookingTime: 35,
      difficulty: "Medium",
      image: "https://images.unsplash.com/photo-1455619452474-d2be8b1e70cd?w=400",
      ingredients: ["coconut milk", "green curry paste", "chicken", "vegetables"],
      tags: ["Gluten-Free"]
    }
  ];

  useEffect(() => {
    setLoading(true);
    setError(null);
    
    // Simulate API call
    setTimeout(() => {
      try {
        let filteredRecipes = [...mockRecipes];
        
        // Apply filters if provided
        if (filters) {
          if (filters.cuisines && filters.cuisines.length > 0) {
            filteredRecipes = filteredRecipes.filter(recipe => 
              filters.cuisines.includes(recipe.cuisine)
            );
          }
          
          if (filters.dietary && filters.dietary.length > 0) {
            filteredRecipes = filteredRecipes.filter(recipe => 
              filters.dietary.some(diet => recipe.tags.includes(diet))
            );
          }
          
          if (filters.cookingTime) {
            const maxTime = parseInt(filters.cookingTime);
            filteredRecipes = filteredRecipes.filter(recipe => 
              recipe.cookingTime <= maxTime
            );
          }
        }
        
        // Apply search results if provided
        if (searchResults && searchResults.length > 0) {
          filteredRecipes = searchResults;
        }
        
        setRecipes(filteredRecipes);
        setLoading(false);
      } catch (err) {
        setError('Failed to load recipes');
        setLoading(false);
      }
    }, 500);
  }, [searchResults, filters]);

  if (loading) {
    return (
      <div className="recipe-list">
        <div className="loading">
          <div className="spinner"></div>
          <p>Loading delicious recipes...</p>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="recipe-list">
        <div className="error">
          <p>😞 {error}</p>
          <button onClick={() => window.location.reload()}>Try Again</button>
        </div>
      </div>
    );
  }

  if (recipes.length === 0) {
    return (
      <div className="recipe-list">
        <div className="no-results">
          <h3>🍽️ No recipes found</h3>
          <p>Try adjusting your search criteria or filters</p>
        </div>
      </div>
    );
  }

  return (
    <div className="recipe-list">
      <div className="recipe-header">
        <h2>🍳 Discover Recipes</h2>
        <p>{recipes.length} recipe{recipes.length !== 1 ? 's' : ''} found</p>
      </div>
      
      <div className="recipes-grid">
        {recipes.map(recipe => (
          <RecipeCard key={recipe.id} recipe={recipe} />
        ))}
      </div>
    </div>
  );
};

export default RecipeList;
